<script>
function openSessionViewFromSelectedThumbnail(sessionID){
    var itemViewElement = document.getElementById("itemView");
    var itemsElements = document.getElementById("items");
    var albumViewContainer = document.getElementById("albumViewContainer");

    document.body.style.overflow = "hidden";
    albumViewContainer.style.position = "absolute";
    itemsElements.style.position = "absolute";
    itemViewElement.style.zIndex = "100";
    itemViewElement.style.position = "fixed";
    itemViewElement.classList.remove('hidden');
    itemViewElement.classList.add('visible');
    openSessionView(sessionImages, sessionID);
    adjustItemSessionTitleViewForSmallScreen();
}

$('.thumb').click(function(event) {
    const sessionID = $(this).attr('data-session-id');
    openSessionViewFromSelectedThumbnail(sessionID);
    trackPhotoOrVideoBandwidth($(this).attr('data-fileType'),
                                $(this).attr('data-fileSource'),
                                'NDM2NTY1',
                                '7382949',
                                $(this).attr('data-fileSize'));
    trackFileAge($(this).attr('data-fileCreated'),
                                    $(this).attr('data-fileSource'));

    return false;
});

function checkForVerticalImageForAlbumBanner() {
    const albumBannerImage = document.getElementById("album-banner-image");
    if(albumBannerImage){
        const height = albumBannerImage.naturalHeight;
        const width = albumBannerImage.naturalWidth;
        if(albumBannerImage && height > width){
            albumBannerImage.classList.add('width-100p');
        }
    }
}

</script>

<script>
jQuery(document).ready(function($) {
    window.addEventListener('popstate', function(event) {
        let url = window.location.pathname;
        let eMatch = url.match(/^\/e\/(.+)/); // Match "e/anything"
        let uMatch = url.match(/^\/u\/(.+)/); // Match "u/anything"

        if (eMatch || uMatch) {
            window.location.reload();
        }
    });
        checkForVerticalImageForAlbumBanner();
    $("#album_url").val(location.href) ;

    $('.share').click(function(event) {
        var action = $(event.target).closest("a").data('ga') ;
        var url = location.pathname + "/" + action;

        gtag('event', 'share', {
            'event_action': action,
            'event_label': location.pathname,
            'page_location': url,
            'value': 1
        });
    })
    
        lazySizes.init();
    
    $('#image-filter').change(function(event){
    			var filter = $('#image-filter').val();
    			if(filter=='all'){
    				$("*[data-type='mp4']").fadeIn(300);
    				$("*[data-type='jpg']").fadeIn(300);
    			} else if(filter=='print'){
    				$("*[data-type='mp4']").fadeOut(300);
    				$("*[data-type='jpg']").fadeIn(300);
    			} else if(filter=='gif'){
    				$("*[data-type='mp4']").fadeIn(300);
    				$("*[data-type='jpg']").fadeOut(300);
    			}
    		});

     if ($("*[data-type='mp4']").length == 0 || $("*[data-type='jpg']") == 0) {
         $("#image-filter").remove() ;
     }
    window.addEventListener('resize', function(){
        adjustItemSessionTitleViewForSmallScreen();
        if(window.location.href.includes("i/") && galleryThumbsSwiper.slides.length > 1){
            editGalleryThumbsCSS();
        }
    });
    adjustItemSessionTitleViewForSmallScreen();
});

</script>

            unit = "MB";
        }
        else {
            convertedSize = (totalZipsize / 1000000000).toFixed(2);
